import React from 'react';

function About() {
  return (
    <section className="about">
      <div className="container">
        <div className="about-text">
          <h2>Joanne Wang</h2>
          <p>
            A real estate broker of Keller Williams Integrity Realty in Ottawa, graduated with a Master of Management from a top-tier university, Joanne is a respected Ottawa Agent, recognized for her expertise and client-centric approach!
          </p>
          <button className="btn">Get Connected</button>
        </div>
        <div className="about-image">
          <img src="/images/Me1.jpg" alt="Joanne Wang" />
        </div>
      </div>
    </section>
  );
}

export default About;
